using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

namespace Practice.Leetcode.Array
{
    class smaller
    {
        public static void Main(string[] args)
        {  
            int[] A = {  };
            int K = 8;
            smaller OB = new smaller();
            bool result = OB.solution(A, 3 );

            string result2 = OB.solution2("");
        }


        public bool solution(int[] A, int K)
        {
            int n = A.Length;
            for (int i = 0; i < n - 1; i++)
            {
                if (A[i] + 1 < A[i + 1])
                    return false;
            }
            if (A[n - 1] > K)
                return false;
            else
                return true;
        }

        public string solution2(string S)
        {
            while (S.Contains("AA") || S.Contains("BB") || S.Contains("CC"))
            {
                if(S.Contains("AA"))
                    S = S.Replace("AA", "");
                if (S.Contains("BB"))
                    S = S.Replace("BB", "");
                if (S.Contains("CC"))
                    S = S.Replace("CC", "");
            }
            return S;
        }
    }
}
